import React from "react";
import { NavLink } from "react-router-dom";

function NavBar() {
    return (
      <div className="nav">
        <NavLink exact to="/" className="ui inverted yellow button">Home</NavLink>

        <NavLink exact to="/users/create" className="ui inverted yellow button">New User</NavLink>

        <NavLink exact to="/users/index" className="ui inverted yellow button">Users</NavLink>

        <NavLink exact to="/rounds/new" className="ui inverted yellow button">New Round</NavLink>

        <NavLink exact to="/rounds/index" className="ui inverted yellow button">Rounds</NavLink>
      </div>
    );
  }

export default Navbar;
